import React from 'react';
import { motion } from 'framer-motion';
import { FaTrophy, FaCertificate, FaAward, FaMedal } from 'react-icons/fa';

const Achievements = () => {
  const achievements = [
    {
      icon: FaTrophy,
      title: 'Best Web App Award',
      organization: 'Tech Innovation Summit 2023',
      description: 'Recognized for outstanding user experience and innovative design in the E-Commerce Platform project.',
      date: '2023',
      category: 'Award',
    },
    {
      icon: FaCertificate,
      title: 'AWS Certified Developer',
      organization: 'Amazon Web Services',
      description: 'Certified in developing and maintaining applications on the AWS platform.',
      date: '2023',
      category: 'Certification',
    },
    {
      icon: FaAward,
      title: 'Outstanding Performance',
      organization: 'Previous Company',
      description: 'Awarded for exceptional contribution to team projects and client satisfaction.',
      date: '2022',
      category: 'Recognition',
    },
    {
      icon: FaMedal,
      title: 'Hackathon Winner',
      organization: 'CodeFest 2022',
      description: 'First place in the 48-hour hackathon for developing an innovative task management solution.',
      date: '2022',
      category: 'Competition',
    },
    {
      icon: FaCertificate,
      title: 'React Developer Certification',
      organization: 'Meta (Facebook)',
      description: 'Professional certification in React development and modern JavaScript practices.',
      date: '2022',
      category: 'Certification',
    },
    {
      icon: FaAward,
      title: 'Client Excellence Award',
      organization: 'Digital Agency',
      description: 'Recognized for delivering exceptional results and maintaining high client satisfaction.',
      date: '2021',
      category: 'Recognition',
    },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
      },
    },
  };

  const itemVariants = {
    hidden: { y: 30, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.6,
        ease: 'easeOut',
      },
    },
  };

  const getCategoryColor = (category) => {
    switch (category) {
      case 'Award':
        return 'bg-yellow-100 text-yellow-800';
      case 'Certification':
        return 'bg-blue-100 text-blue-800';
      case 'Recognition':
        return 'bg-green-100 text-green-800';
      case 'Competition':
        return 'bg-purple-100 text-purple-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <section id="achievements" className="py-20 bg-white">
      <div className="container mx-auto px-6">
        <motion.div
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true, amount: 0.3 }}
          className="max-w-4xl mx-auto"
        >
          {/* Section Title */}
          <motion.div variants={itemVariants} className="text-center mb-16">
            <h2 className="text-4xl md:text-5xl font-bold text-gray-900 mb-4">
              <span className="gradient-text">Achievements</span> & Awards
            </h2>
            <div className="w-24 h-1 bg-gradient-to-r from-blue-600 to-purple-600 mx-auto rounded-full mb-6"></div>
            <p className="text-lg text-gray-600 max-w-2xl mx-auto">
              Recognition and milestones that highlight my dedication to excellence and continuous learning.
            </p>
          </motion.div>

          {/* Achievements Grid */}
          <div className="grid md:grid-cols-2 gap-6">
            {achievements.map((achievement, index) => (
              <motion.div
                key={achievement.title}
                variants={itemVariants}
                whileHover={{ y: -5 }}
                className="bg-gray-50 rounded-xl p-6 hover:bg-gray-100 transition-colors group"
              >
                <div className="flex items-start space-x-4">
                  {/* Icon */}
                  <div className="flex-shrink-0">
                    <div className="w-12 h-12 bg-gradient-to-r from-blue-600 to-purple-600 rounded-lg flex items-center justify-center text-white group-hover:scale-110 transition-transform">
                      <achievement.icon size={20} />
                    </div>
                  </div>

                  {/* Content */}
                  <div className="flex-1 min-w-0">
                    <div className="flex items-center justify-between mb-2">
                      <h3 className="text-lg font-semibold text-gray-900">
                        {achievement.title}
                      </h3>
                      <span className={`px-2 py-1 text-xs font-medium rounded-full ${getCategoryColor(achievement.category)}`}>
                        {achievement.category}
                      </span>
                    </div>

                    <p className="text-sm font-medium text-blue-600 mb-2">
                      {achievement.organization}
                    </p>

                    <p className="text-gray-600 text-sm leading-relaxed mb-3">
                      {achievement.description}
                    </p>

                    <p className="text-xs text-gray-500 font-medium">
                      {achievement.date}
                    </p>
                  </div>
                </div>
              </motion.div>
            ))}
          </div>

          {/* Stats Section */}
          <motion.div
            variants={itemVariants}
            className="mt-16 bg-gradient-to-r from-blue-600 to-purple-600 rounded-2xl p-8 text-white text-center"
          >
            <h3 className="text-2xl font-bold mb-6">Achievement Summary</h3>
            <div className="grid grid-cols-2 md:grid-cols-4 gap-6">
              {[
                { number: '6+', label: 'Awards & Certifications' },
                { number: '3', label: 'Hackathon Wins' },
                { number: '100%', label: 'Client Satisfaction' },
                { number: '5+', label: 'Years Learning' },
              ].map((stat, index) => (
                <div key={stat.label}>
                  <div className="text-3xl font-bold mb-2">{stat.number}</div>
                  <div className="text-blue-100 text-sm">{stat.label}</div>
                </div>
              ))}
            </div>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default Achievements;
